        private static void Print(string inputString)
        {
            int len = inputString.Length;

            foreach (char c in inputString)
            {
                Console.Write($"{c} , ");
            }

            Console.WriteLine();

            for (int n = 0; n < len; n++)
            {
                Console.Write($"{n,-2}, ");
            }

            Console.WriteLine();
            Console.WriteLine();
        }

        private static string HackerRankInString(string inputString)
        {
            inputString = inputString.ToLower();
            const string hackerrank = "hackerrank";
            int n = 0;

            if (inputString.Length < hackerrank.Length)
            {
                return "NO";
            }

            foreach (char c in inputString)
            {
                if (n < hackerrank.Length && c == hackerrank[n])
                {
                    n++;
                }
            }

            return n == hackerrank.Length ? "YES" : "NO";
        }

        private static string HackerRankInString2(string inputString)
        {
            inputString = inputString.ToLower();
            const string hackerRank = "hackerrank";

            if (inputString.Length < hackerRank.Length)
            {
                return "NO";
            }

            Dictionary<char, List<int>> indexDictionary = CreateIndexDictionary(inputString);
            int previousIndex = -1;
            bool containsHackerRank = true;

            foreach (char c in hackerRank)
            {
                if (!indexDictionary.ContainsKey(c))
                {
                    containsHackerRank = false;
                    break;
                }

                List<int> indexList = indexDictionary[c];

                if (indexList.Count == 0)
                {
                    containsHackerRank = false;
                    break;
                }

                while (indexList.Count > 0)
                {
                    int index = indexList[0];
                    //Console.Write($"({c}, {index}) < ");
                    indexList.RemoveAt(0);

                    if (index > previousIndex)
                    {
                        previousIndex = index;
                        break;
                    }

                    if (indexList.Count == 0)
                    {
                        containsHackerRank = false;
                        break;
                    }
                }

                if (!containsHackerRank)
                {
                    break;
                }
            }

            return containsHackerRank ? "YES" : "NO";
        }

        private static Dictionary<char, List<int>> CreateIndexDictionary(string s)
        {
            Dictionary<char, List<int>> indexDictionary = new Dictionary<char, List<int>>();
            int len = s.Length;

            for (int n = 0; n < len; n++)
            {
                char c = s[n];

                if (!indexDictionary.ContainsKey(c))
                {
                    indexDictionary[c] = new List<int> {n};
                }
                else
                {
                    indexDictionary[c].Add(n);
                }
            }

            return indexDictionary;
        }

